import React from 'react';
import { Layout } from '../../components/layout/Layout';
import StatisticalSection from '../../components/statistical/StatisticalSection';

const StatisticalPage = () => {
  return (
    <Layout>
      <div>
        <StatisticalSection/>
      </div>
    </Layout>
  );
};

export default StatisticalPage;
